import React from 'react';
import { FaBriefcase, FaEnvelope, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
function NavigationItems() {

    const nav_items = {
        backgroundColor: "red"
    }
    return (
        <ul className="navigation_items" style={nav_items}>
            <li><FaHome /></li>
            <li><FaUser /></li>
            <li><FaGraduationCap /></li>
            <li><FaBriefcase /></li>
            <li><FaEnvelope /></li>
        </ul>   
        
      );
}

export default NavigationItems;
